import React from 'react';
import {Link} from 'react-router-dom';
import './Navbar.css';

import home_icon from '../assets/icons/home_icon.png';
import works_icon from '../assets/icons/works_icon.png';
import cert_icon from '../assets/icons/cert_icon.png';
import cont_icon from '../assets/icons/cont_icon.png';


function Navbar() {
  return(
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <Link className="navbar-brand" to="/"><h4>Michael Babozhko</h4></Link>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent" >
          <ul className="navbar-nav ml-auto">
              <li className="nav-item">
                <Link className="nav-link" to="/">
                <img className="fluid" src={home_icon}/>
                 Home</Link>
              </li>

              <li className="nav-item">
                <Link className="nav-link" to="/works">Works</Link>
              </li>

              <li className="nav-item">
                <Link className="nav-link" to="/certificates">Certificates</Link>
              </li>

              <li className="nav-item">
                <Link className="nav-link" to="/contact">Contact</Link>
              </li>
            </ul>
          </div>
      </div>
    </nav>
  );
}

export default Navbar;
